import { navLinks, audits } from "../data";
import { lolosArrowForward } from "react-icons/io";
import { Link } from "react-router-dom";
import HomeCategories from "../components/HomeCategories";
import Audits from "../components/Audits";

function Home() {
  //home audits displayed
  const [homeAudits, setHomeAudits] = useState(audits);
  //home categories to filter audits displayed
  const [homeCategories, setHomeCategories] = useState([]);
  //filter audits based on category
  const filterAudits = (category) => {
    if (category === "all") {
      setHomeAudits(audits);
    }
    const filteredAudits = audits.filter((audit) => audit.resolved);
  };
  return (
    <main>
      <HomeCategories />
      <Audits />
      <div className="underline"></div>
    </main>
  );
}

export default Home;
